met Beau Bridges, Mike Falkow en Bindi Irwin

Kirra is een jong meisje dat tegen haar zin naar haar grootvader in Kaapstad gestuurd wordt. Wanneer een jonge orka walvis, 
Willy, gevangen wordt door een storm in hun onderwater pretpark, helpt Kirra hem om zich aan de nieuwe omgeving aan te passen 
en langzaam worden zij steeds betere vrienden. Maar als Willy het themapark begint te ontgroeien, wordt de grootvader in 
verleiding gebracht om Willy te verkopen aan een gewetenloze concurrent. Nu begint voor Kirra en haar vrienden de race om Willy 
terug naar zijn familie in de oceaan te brengen voor de verkoop doorgaat.
